import styled from "@emotion/styled";

export const StyledLoginForm = styled("div")`
  display: flex;
  background-color: #fff;
  padding: 16px;
  border: 1px solid rgba(5, 5, 5, 0.06);
  border-radius: 8px;
  max-width: 400px;
  width: 100%;
  flex-direction: column;
`;
